  true,\n\t\"url\": null,\n\t\"notes\": \"Services and Support Programs for Military
  Service Members and Veterans, 2012-13 (PEQIS 19), is a study that is part of the
  Postsecondary Education Quick Information System (PEQIS) program; program data is
  available since 1997-98 at <http://nces.ed.gov/pubsearch/getpubcats.asp?sid=016>.
  PEQIS 19 (http://nces.ed.gov/peqis/) is a cross-sectional survey that collected
  information on the services and support programs available to students who are military
  service members and veterans at the institution. The study was conducted using self-administered
  paper-and-pencil questionnaires of a person at the postsecondary institution that
  is familiar with the institutionu2019s programs for military service members and
  veterans. Key statistics produced from PEQIS 19 were services and support programs
  for military members and veterans.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
